                'descr' => 'Bassam Ounssi, president of Carlton Construction Inc., is a graduate civil engineer from the United Kingdom with more than 40 years of construction experience, over 20 years of which are in Houston. After 10 years in England working on various housing, office building and civil engineering projects he spent 12 years overseas where he discovered his passion for the construction of large housing projects, major hotels and palace complexes.

