            64 =>
            array (
                'id' => 65,
                'name' => 'Domus Homes',
                'slug' => 'domus-homes',
                'descr' => 'Mikes initiation into the construction business began at the age of 12, working as a laborer on his fathers construction projects. Moving quickly up through the ranks to job superintendent, then General Manager, Mike became a partner at the age of 30. He founded his own firm, Neuffer Homes and Development in 1986 and his custom home division, Legacy Custom Homes, and Silverado, his excavation company soon followed.

Neuffers work was innovative, being the first to bring energy efficient homes on a production basis into the Northern Nevada housing market. Neuffer Homes soon earned the prestigious Northern Nevada Builder of the Year Award.

While head of one of the regions largest and most successful construction companies, Neuffer built over 2000 homes ranging from entry level to luxury estates.
In 2001 Mike made the decision to pursue another passion, winemaking, and founded Nicholas Cole Cellars,  building, developing and planting 268 acres of vineyard winery and residential properties in Walla Walla, WA.

During his years as a businessman in Nevada, Neuffer volunteered and built two homes for Habitat for Humanity, served on various boards including the Reno Opera, and sponsored two of the local elementary schools. Mike continued to invest in his community when he moved to Eastern Washington to build his winery and vineyard.

There he was a founding member of Walla Walla Valleys sustainable farming organization, Vinea, and a major donor to the Walla Walla Community College Viticulture and Enology building.

Mike has also supported and donated to Seattle Childrens Hospital, arts and education programs, and other causes.

Early in 2010, enthusiastic about what he saw as a change in the needs of todays home buyers and the monumental shift in residential construction, Mike was drawn back into the building industry and founded Domus Homes. His vision was to craft high quality, affordable homes geared toward first time home buyers and families in established community settings. Taking into consideration the adjusted priorities of families and embracing the urban lifestyle desired by todays home buyers, it is the goal of Domus Homes to redefine quality and value when it comes to affordability. Domus is different, and as soon as you step into one of our homes, we think you will see why.',
