                'descr' => 'Since 1958, United Built Homes has helped more than 39,000 families build the home of their dreams.  UBH grew out of a Shreveport, Louisiana building supply business in 1958. When UBH was formed as a home-building and financing corporation, its mission was to help area families make their dreams of home ownership a reality. To this day, that mission remains the same.The United Built system worked so well that the company expanded into neighboring states, and affiliated companies developed to cover all phases of home sales, financing, and building.  We still have our central lumberyard in Shreveport, Louisiana. Our corporate offices are located in Springdale, Arkansas and Shreveport, Louisiana. When you arrange for your United Built home with your local office, UBH delivers our top quality dimensional lumber materials from our Shreveport lumberyard. This means that we have central oversight, quality assurance, and the best possible prices. The efficiency and the savings are considerable.  But we re still small enough to give you personal attention. You ll get to know the people at your local office. United Built s professional staff will build a relationship with you so they can meet your needs.',
