            'descr' => 'The custom homebuilding and home buying process is a major commitment by the owner and members of Davis Builders. The principals share over forty-years experience in the homebuilding industry to serve our clients. Moreover, these experiences rely in many ways on customer service, the hallmark of completing great homes and satisfying our clients.

Our team of experienced professionals believe that the success in any building endeavor is a result of collaboration and communication from all members. Our homeowner is central to this philosophy and our core strength is to forge lasting satisfaction for years after move in. Our strength for our custom clients is the confidence to "integrate" all facets of their project from initial design, including collaboration with their chosen designer, architect, consultants into value engineering, bidding, and through construction and completion. Our collective portfolio of custom and speculative homes in Houston\'s finest areas allow us versatility to build from either a moderate priced cottage to a one of a kind multi-million dollar estate home.',
