            'name' => 'Surge Homes',
            'slug' => 'surge-homes',
            'descr' => 'Surge Homes is revolutionizing Houston\'s Inner Loop by building innovative developmentsin sought-after neighborhoods -- at unmatched price points. Offering a diverse range of home types, including condominiums, townhomes and luxurious single family-homes, Surge Homes is the fastest-selling new home builder in its market.
