            'name' => 'Southland Homes',
            'slug' => 'southland-homes',
            'descr' => 'If you are contemplating building a custom home in the Greater Houston area, or if you are looking to expand your space with a custom addition, the builder you choose can make all the difference in turning your dream into a reality. Southland Homes of Texas has specialized in high-end custom homes and renovations for years. We have received accolades for our work, including a featured article in Houston House & Home Magazine, and were the recipient of the Good Brick Award from the Greater Houston Preservation Alliance. When you choose Southland Homes, you become the beneficiary of our years of experience and our dedication to bringing our clients visions to fruition.
