            'name' => 'Royal Texan Homes',
            'slug' => 'royal-texan-homes',
            'descr' => 'Inspired by heritage, Royal Texan Homes is the unique vision of our founder Mark Garraty.
After leaving school in the UK, Mark joined one of the most established firms of Chartered Surveyors in London, located in the famous Lincolns Inn Fields.Over the course of almost a decade, Mark personally found and renovated post industrial revolution homes and cottages in the North of England and was at the vanguard of regeneration programs that have transformed English cities such as Liverpool, Leeds, Doncaster and Hull.
Marks passion and understanding of Architectural styles combined with historical narrative are rarely available to most residential home buyers. His influence is everywhere and our client meetings are fascinatingly educative, creating an enjoyable project environment with unique opportunities for our clients.
Marks passion was to bring the build quality and elegance of these unique homes to the American market and make them available not just to the exclusive custom home buyer but to all who desire a standard of home and living that is currently not served in the conventional real estate market.
Mark is very visible in community life and our company. He is a frustrated soccer player (having never had the talent to be good) and supports local schools, charities, activities and sports teams across Montgomery County and Greater Houston. Our corporate function is to serve and our community spirit is the same. Please contact us to find out more about who we are.',
