        430 =>
        array (
            'id' => 432,
            'name' => 'Bentley Custom Homes',
            'slug' => 'bentley-custom-homes',
        'descr' => 'Bentley Homes was founded in 1994 by Menny Rosenbaum. Menny began his career with a degree in Visual Arts and Design. He then went on to study construction management and received a prestigious designation of Real Property Administrator (RPA) from the Building Owners and Managers Institute. In January of 2011, Menny Rosenbaum joined forces with Philip Robbins, formerly of Levitt & Robbins Custom Homes. Philip earned his Bachelor of Arts Degree in Economics from the University of Texas. In 2001, he received the Bellaire Citizen of the Year Award, and served on the Bellaire Drainage Citizens Advisory Task Force in 2003. Philip has shown his dedication to his community by building the 1996 ASID Designer Showhouse benefiting the Susan G. Komen Breast Cancer Foundation and Sunshine Kids of Houston, building the 75 Year Anniversary Home of the 90s for the AIA Home Tour in 1999, renovating the Bellaire Trolley Pavilion in 2000, and building the Bellaire High School Baseball/Softball Locker Room Facility.

Their knowledge, creativity and education, coupled with over 43 years of professional experience in all aspects of the building trades, bring an exceptional level of professionalism and commitment to each and every home they build.  With a personal involvement which starts with the design conception and carries all the way through to the finished product, Menny and Philips hands-on approach ensures the highest degree of quality and customer service. Together, Menny with Bentley Homes and Philip previously with Levitt & Robbins Custom Homes, have earned a combined 74 awards!

Menny and Philip live with their families in Bellaire, one of the communities in which they build. Many of their clients become friends after the construction of their new home! Their reputation is the most important thing! Its how the company gets new business.

It is no surprise that Bentley Homes has earned the reputation of being one of the premier builders in the area amongst their clients and other builders. Menny Rosenbaum and Philip Robbins operate every day on the belief that customer satisfaction, promptness and keeping promises are an integral part of doing business in the world today.

The philosophy of Bentley Homes is not how many homes we can build, but how well we can build them. We build a limited number of homes each year the old fashion way. We concentrate our efforts on the close personal attention to every detail, quality and style. Because Menny and Philip personally supervise the construction on a daily basis, Bentley Homes is able to pass on the cost savings, exceptional quality and personal touch to all their clients.

We will custom build anywhere in Houston, Bellaire, West University, South Side Place, Braes Heights, Braes Oaks, Afton Oaks, Meyerland, Meyerpark, Memorial, Tanglewood, Briargrove, Hunters Creek Village, River Oaks and in all surrounding neighborhoods. Get the custom home of your dreams! Call or email us today for your new dream home!',
