            'id' => 492,
            'name' => 'Icon Home',
            'slug' => 'icon-home',
            'descr' => 'ICON HOME is headed by Damian Ogier. Originally from Sydney, Australia, Damian is a proud husband and father of three who has built his own homes and his family in Houston\'s historic Heights neighborhood. President of Icon Home,Trentham Development and managing partner of Icon Insurance Advisors, Damian is a passionate entrepreneur and financial services professional with two decades of experience in the insurance industry and 17 years developing luxury homes, designing landscape and interior environments. Active in his community as Race Director of the Heights Fun Run and serving on the Board of Directors of the Houston Heights Association,Damian is also a professional musician and an occasional ultra-runner.
Damian studied Musical performance and History at Loyola University New Orleans where he lived-in and fell in love with the pre-Civil War-era houses and landscapes of New Orleans\' Garden District. He went on to study Art History and architecture at Loyola University Chicagos Rome Center in Rome, Italy. This only deepened his appreciation for classic architecture and scale -while conveniently scratching an insatiable travel itch.
Damian oversaw his first construction project in 1998 in what is now a Historic District of the Houston Heights neighborhood. He continued developing residential projects in Houstons inner-loop, always in an effort to improve the historic and eclectic character of the neighborhoods he and his family call home. Damian took on his first full landscape design and install project in 2004, his first interior design commission in 2008 and oversaw the interior renovation of a landmark Houston home in 2013.
Today, dedicated to timeless luxury home development always avoiding the \'cookie-cutter, Damian and his team oversee every aspect of the development process from concept to design, finance to finished selections, architecture, interior and landscape design. This ensures that the final product lives up to their exacting standards and provides their clients a fully-integrated, well thought-out and elegant lifestyle experience.',
