                'id' => 505,
                'name' => 'Chalet Construction',
                'slug' => 'chalet-construction',
                'descr' => 'Doug Meigs grew up in the construction business working for his dad. He formed his first company, Sure-Way Construction, Inc. with a partner in 1969 and built over 300 homes, two subdivisions and a dozen commercial buildings in the Houston area. After 11 years, the company was resolved due to growing interest rates that made new home buying difficult.
In 1980, Doug formed his second company, Chalet Properties, Inc. Although primarily a commercial and industrial venture in the US and overseas, Chalet Properties also provided some residential construction in the Nashville area. However, the early years were mostly industrial, working with companies like Reed Roller Bit, Reed Tubular, Baker Oil Tool, Baker-Hughes and Fina Oil Polypropylene. In the late 80s and early 90s, Chalet Properties was commissioned to build several commercial structures in Saudi Arabia, Peru, Guatemala and Belize, including government housing and employee housing.
In 1996, Dougs son came on board as parter in Chalet Construction, Inc. Doug Jr., like his father before him, also grew up in the construction business, working with different crews and gaining first-hand experience building. Doug Jr. attended Sam Houston State University with a focus in Construction Management. He also attended the University of Houston with a focus in Architectural & Environmental Design.
At Chalet Construction, our commitment to quality home construction ensures your quality of living. We plan residential communities from the concept to the drafting table to engineering of infrastructure to design and development of single family homes subdivisions to multi-family buildings. We pay attention to the smallest details to the elite custom features on all projects.',
