            'descr' => 'Todd received a Bachelor of Science in Quantitative Business Analysis from Louisiana State University and a Master of Business Administration (MBA) from Baylor University. He is an active member of the Texas Association of Builders, the National Association of Home Builders and the Greater Houston Builders Association, where he serves on the Custom Builders Council.
