            120 =>
            array (
                'id' => 622,
                'name' => 'Leigh Homes LLC',
                'slug' => 'leigh-homes-llc',
                'descr' => 'For the past 43 years, Bill Leighs homebuilding team has been the leading builder in The Woodlands. Starting in 1974 with Hometowns first estate home, Bill and his associates have built homes for almost 1,500 of our neighbors. Since 1982, the Leigh team has built and sold more custom homes in our Hometown than the next two builderscombined.
A well built home, crafted to a familys expectations, does not occur by accident. The process takes years of experience and dedication to develop properly, and the Leigh companies have earned a justified reputation as the builder providing the best value in The Woodlands over the past 43 years.
Mr. Leigh and his wife were two of the pioneers in the Woodlands back in 1974, and they have been active in the communitys growth ever since. A licensed attorney, Bill served as The Woodlands first elected Trustee of the Conroe School District, Director-at-Large of the Montgomery County Hospital District, and founding Vice President of the Grogans Mill Village Association.
He helped charter the Woodlands Rotary Club and our Chamber of Commerce, and his wife helped establish The Woodlands Welcome Wagon, Interfaith Child Care Facility, Trinity Episcopal Church, our areas first PTA, and our hospital.
Bill Also holds the distinction of being one of a very few Graduate Master Builders in the Houston region. He and his team work with each family through the design, architectural, engineering, construction and decoration phases. They are personally involved in every stage of every home. The teams leadership and craftsmen (some going back over four decades) will help craft your dreams into a reality you will cherish for years to come.
As a result, Bills companies have been honored with awards, the likes of which most builders can only dream. In 1989, the Leigh team was selected as the first recipient of the coveted Pinnacle Award, presented by the Texas Association of Realtors to the best custom builder in the State of Texas. The Woodlands has named them as the Top Custom Builder in 1997, 1999, 2000, 2001, 2002, 2003, 2004, 2005 and 2007.
But the highest award theyve consistently won has been the continued trust of an overwhelming number of new home buyersfriends who have charged Bill Leigh and his associates with responsibility to build their new home.',
