                'descr' => 'American Villas is an architectural home builder specializing in high-end residential beach home construction in Galveston, Texas. We have a reputation of being one of the most experienced and progressive home builders on the Texas Gulf Coast, incorporating fine craftsmanship with the latest building science methods and FORTIFIED structural engineering standards. As the resident home builder in Beachtown Galveston, American Villas maintains an office and full-time staff in the community and has overseen the completion of the vast majority of homes in the community. Whether building a tiny coastal cottage or grand beach estate, American Villas employs the same level of quality and detail that is seldom seen in beach home construction.
