                'name' => 'Denison Custom Homes',
                'slug' => 'denison-custom-homes',
                'descr' => 'Our family business is construction. Founded in 1977 by Robert Denison, Jr. and continuing today through his daughter and son-in-law, Matt and Lisa Lively, the Denison name is known for some of the best built homes in the area. We love building and it shows in our work. To make your dream home a reality takes collaboration between the builder and the customer. Our job is to help you create a beautiful home with our knowledge and unique concepts and to be able to accommodate your wants and needs as a growing family. Denison Custom Homes is there with you every step of the way from choosing the perfect floor plan to selecting the final details.

DESIGN
A great design isn\'t measured in square footage. It is measured by the way a room feels when you walk in.....
-An open concept with efficient use of space
-Classic exteriors with timeless curb appeal
-Thought and design for furniture placement
-Function for everyday living

Energy Efficiency
One of the largest consumptions of energy goes to heating and cooling buildings. As a standard, Denison Custom Homes uses energy efficient techniques and materials to create a tighter and moreenergy efficient home....
-Radiant barrier roof decking
-High efficiency HVAC systems
-Energy star rating appliances
-Low-E Vinylwindows
-Rockwool blown insulation standard, Spray Foam available
-Choice of many other energy efficient materials on the market',
