                'name' => 'Winfrey Design Build',
                'slug' => 'winfrey-design-build',
                'descr' => 'I can pinpoint a genuine interest in construction and how things are built dating back to my early tree fort building days growing up in San Angelo. When I left Texas A & M with my Construction Science degree in 1987 I headed for Houston and proceeded to learn the profession of homebuilding, first as a field superintendent and then working my way up to project, division and city manager for some of Houstons best known large-volume and custom homebuilding companies.
I built over 400 homes in the process and then managed the construction of another 300 custom homes and townhomes as the co-owner of a development and construction company for 10 years specializing in Houstons inner loop and in-town neighborhoods.
Throughout those years, I have lived in four homes that I have built for myself, including our current house, and I am constantly thinking about how modern families live and what can be done in the design and construction process to improve the quality of my homeowners lives.
