            177 =>
            array (
                'id' => 679,
                'name' => 'Sheppard Custom Homes',
                'slug' => 'sheppard-custom-homes',
                'descr' => 'Tom Sheppard began his building career in 1969, working as a laborer with several local builders. After learning the trade, Tom decided to go out on his own in 1972 and he placed an ad in the paper that read, Painting, Roofing, Remodeling and Additions. After several years of remodeling, Tom built two homes for himself which he then sold and used the profits for his first development in Colchester, Vermont. Tom truly enjoyed working with customers, allowing them to customize their homes exactly the way they wanted.
In 1980, Tom hired Paul Brogna as a laborer and he, too, learned the trade. Pauls skills allowed him to start coordinating the construction details for all of the homes as they were built. Paul became a full partner in the business in 1990 and since then, he is fully involved in every aspect of the construction process. Paul works closely with customers from the design of the homes, to selecting building products, to coordinating all of the labor and materials used on the construction of the home, as well as doing the final walk-through with the customers prior to closing. Paul also works with every customer after we sell a home to ensure their needs and concerns are met.
Since all customers work with Paul, and he deals directly with every vendor and contractor, there are few miscommunications. Customers consistently comment how smooth and enjoyable the construction process is when working with one primary person. Our home offerings range from higher end starter homes and spacious multi-family dwellings, to larger luxury single family homes. We have received awards on all of these housing levels from the NHBRA.
In 2005, Toms youngest son, Peter Sheppard, joined the team at Sheppard Custom Homes. Peters background as owner of Vermont Custom Electrical and Acoustic Interiors allowed him to easily transition into new home construction. He was able to take Sheppard Custom Homes to another level by allowing our customers to customize home audio video needs. Peter has now partnered with Sheppard Custom Homes as a Construction Coordinator.',
