            213 =>
            array (
                'id' => 715,
                'name' => 'Marshall Building, Inc.',
                'slug' => 'marshall-building-inc',
                'descr' => 'Your home is a direct reflection of your success. You enjoy the finest that life has to offer and you wish to be surrounded by those amenities daily. You want your home to mirror the style, drama, and uniqueness that embody your accomplishments. However, finding that builder with an edge in sophistication and the keen sense to grasp your spirit and individuality can be an exhausting task. Skip Marshall and his dedicated team at Marshall Building have the experience and expertise to create a high-end custom home that captures the concepts of your image. You can trust that they will do whatever it takes to craft a masterpiece that will rise above your expectations.
Customer satisfaction is a high priority with Marshall. Their cutting-edge designers and architects work one-on-one with each client to find the best way to incorporate your needs and lifestyle into your plans. Detailed specifications assure the buyer of quality custom products and unique design. Flexibility to a clients wishes is important to Marshall Building, because they know that each home must encompass the individuality of its owner. Our clients can be confident of personalized service, with consistent on-site management of the homes under construction and our after-the-sale service is rivaled by none, says Darrell OConnor of their superior dedication to customers. To ensure that all details are attended to, a preliminary walk-through is completed prior to closing on the home. A secondary walk-through is conducted where any small items which have gone unnoticed are corrected. Marshall Building is not going to vanish once the sale is complete.
Skip has been building high-end custom homes around the Houston area in exclusive communities such as The Woodlands, Auburn Lakes, Spring Creek Oaks, Champions Forest, Terranova West, Lakewood Oaks, Northgate Forest and the Tomball area for over twenty years. They continue to rise above their competitors by exploring the latest designs and techniques that are available. As a result, their homes are exciting and impressive. Their attention to every minute detail and the use of the highest quality materials create exceptional homes with interest and style. From the state of the state-of-the-art appliances to the most recently developed decorating trends, Marshall homes exhibit the newest and best in homebuilding.
