            242 =>
            array (
                'id' => 744,
                'name' => 'Jonathon Custom Home',
                'slug' => 'jonathon-custom-home',
                'descr' => 'Building a custom home is a serious undertaking. An extensive period of planning, organizing, and anticipation usually precedes it. Most new homebuyers only build once or twice in their lifetime and are naturally inexperienced in making the many decisions that will be necessary in this planning process. The process can seem overwhelming and frustrating at times. Patience, understanding, and a good source of information are key in planning, designing, and building your new custom home. The place to start is organizing your wants and needs for your new home. Write down your specific concerns or ideas that you can describe to your homes designer/builder. Then take the next step and create a profile on Houzz, the home design website that allows you to keep all your thoughts and ideas organized in one convenient place. Houzz lets you keep track of interior as well as exterior design ideas by saving specific photos into ideabooks, where you can make notes of colors and design
Write down all your thought and ideas about this project and the more organized you are the more accurate your project will be. Stay focused on the project when working on one area and put the project away when it becomes frustrating. Keep your thoughts organized and at your fingertips and this will help lower your level of frustration. Planning, designing and building should be an enjoyable experience for you if you take one step at a time and do not rush the planning and designing process. When working with your partner remember to compromise and be considerate of each others ideas and needs.
Research as must information as you need for making an educated decision. At Jonathon Custom homes we have a list of suppliers and sales people for you to shop your product selections. Each supplier will give you a written price for you to keep in you organizer. The selection of products you should research are exterior finishes, windows, exterior doors, driveway finishes, roofing, appliances, hardware, flooring, cabinetry, interior trim work, plumbing fixtures, light fixtures, audiovisual systems, security systems, phone systems, and any special areas you will want. Your selections of product will help set your estimated budget allowances for your new home. Using the Internet for research will help easily identify brand name products and specifications. Have a meeting with an experienced Certified Builder who will share information and ideas to help you with your budgeting, financing, lot selection, home design and material specifications. A good custom builder will have all the information you need to make your planning and design decisions.',
                'email' => 'jonathoncustomhomes@gmail.com',
                'address1' => '9225 Katy Freeway Ste 102,',
                'address2' => 'Houston, TX 77024',
                'address3' => '',
                'city' => NULL,
                'phone' => '7133509822',
                'website' => 'http://jonathoncustomhomes.com/getting-started/',
                'hidden' => 0,
                'created_at' => '2016-04-12 10:08:33',
                'updated_at' => '2020-03-09 14:48:13',
            ),
            243 =>
            array (
                'id' => 745,
                'name' => 'Leckhampton Homes',
                'slug' => 'leckhampton-homes',
                'descr' => 'Leckhampton Homes understands your expectations and what it means to exceed them. Leckhampton Homes represents over seventy years and three generations of home building experience. It has always been a Norwood tradition to provide families with the best quality home at the most affordable price.

The Norwood family began building homes in Houston in the 1950s, when homes were less than $10,000 and interest rates were a whopping 3%. The Norwoods began setting the pace to meet the growing demand for housing. They were the first builders to have model home parks and to furnish their models. The Norwoods also revolutionized the high standards of quality control for home building and community development. They were the first to build "master-planned communities." More than 23,000 home buyers enjoyed a solid investment with their home.

In 1990, the Greater Houston Builders Association honored the Norwoods as the pioneers of the home building industry as it is known today. It was also the year Steve Norwood chose to once again build affordable homes in the Houston area.

Exceeding your expectations is standard at Leckhampton Homes. Trust the experience of the family that revolutionized Houston home building.',
