                'descr' => 'Founded in 2004 by Bryan Phillips, Cason Graye Homes has endeavored to hear and understand what prospective homeowners like, what inspires them, and what makes them and their families feel safe and satisfied. Only then can we interpret those values to create a home that exceeds their expectations, and of which they will be proud. Because we employ a trusted, proven methodology, a team of experienced architects, contractors and construction personnel,and use only the highest-quality and energy efficient materials, we consistently deliver truly custom homes at a great value in Houstons finest neighborhoods.
