                'id' => 755,
                'name' => 'Gabriel Home Builders',
                'slug' => 'gabriel-home-builders',
                'descr' => 'The planning process begins with an extensive Client Questionnaire which gives the Gabriel Home Builders team an inside look into the clients lifestyle and preferences. It addresses the personality that the home should have, from how the bathrooms should look and how the kitchen should function to what the overall feel of the home should be. This then leads to a Features Questionnaire which covers all aspects of construction and finish styles. This is where clients can comment on the kind of finishes or materials they desire, such as flooring, countertops and woodwork. This planning process is typically done in cooperation with a clients architect and/or interior designer.

The next stage has the Gabriel Home Builders team beginning to develop the clients dream home on paper, followed by a preliminary estimate that ensures the budget guidelines are being met. Once the plans are complete, the client is given a detailed estimate of costs along with a very detailed specification list, so that when it is time to start construction, the client is confident that GHB has left no stone unturned. Clients can move forward with the assurance that Gabriel Home Builders has paved the path for a successful building plan.

Once an agreement is reached on any new project, Gabriel Home Builders sends a courtesy letter to the clients immediate neighbors informing them of the upcoming construction start time, along with company contact information. This caring attention to detail and consideration for others has resulted in solid relationships wherever GHB builds.',
