            'descr' => 'Savannah Construction is a Minority and Women Business Enterprise (MWBE), family owned and operated, servicing the Greater Houston Area for over 11 years. Our sister company, Rodriguez Paint Contractor, continues to hold a spot as one of Houston\'s leading paint subcontractors for over 25 years.

