                'slug' => 'park-line-builders',
                'descr' => 'Park Lane Builders is a family-owned, custom residential construction company in Houston, TX. Since 1989, Park Lane has built some of the finest and most qualitative homes in influential neighborhoods around the city; namely, River Oaks, Afton Oaks, Shadyside, West University, Bellaire, Hunters Creak, Memorial, Tanglewood, Braes Heights, and the Heights. Park Lane specializes in new construction, renovations, additions, historical preservation, maintenance and repairs. Our philosophy is building a strong team around the client, and tailoring the project to accommodate their specific needs, goals and personality. We guide our clients through the construction journey with detailed and proven processes that ensure communication and efficiency. Our unique approach creates enjoyable experiences and lasting relationships. We are committed to working with you to create a healthy and beautiful home  one built with integrity and quality for your family to enjoy.',
