            441 =>
            array (
                'id' => 943,
                'name' => 'Charles Michael',
                'slug' => 'charles-michael',
                'descr' => 'Charles Michael Custom Homes provides a wide range of architectural and construction needs to the Galveston, Bolivar and Greater Houston Area.  The Charles Michael Team prides themselves on their customer centered construction practices and emphasis on structural integrity, luxury and design.  We understand that building a new home is an investment and we are appreciative of the trust that our customers have placed in us.  Client testimonials and word of mouth have helped build Charles Michael Homes and continue toward its successful growth in the future.

Partners Charles Shaw and Michael La Foy have been building Custom Homes together since 1993.  They each bring over 20 years of Home Building experience and have worked together to build some of the finest Homes in the Galveston, Bolivar and Greater Houston Area.  Charles and Michael understand that a Custom Home is a combination the clients vision and their experience, and work hand in hand with their customers to ensure that dreams are turned into reality.  Charles and Michael also understand that the relationship between the customer and the builder does not end at the completion of the project.   The Charles Michael Team is dedicated towards ensuring full customer satisfaction.

Charles Chuck Shaw

Chuck has been in the construction industry since 1992. He was a Construction Sciences major at Texas A&M University. Chuck has had family in the Galveston Bay area since the 1800s with one family member building homes on Crystal Beach in the 1960s. He is a father of 3 sons, an avid outdoors man and is active in the Houston Livestock Show & Rodeo. In addition, he serves as Scout Master for his sons Boy Scout Troop. Chuck has worked on and built some of the finest custom homes in the Houston Metro and Bolivar Areas. With a career long passion for durable construction and customer interaction, he is proud to be building custom Bolivar homes where his ties to the history and community run deep.

Michael  Mike LaFoy

Mike graduated from the University of Houston in 1990 and has been involved in most every aspect of residential construction ever since. He has worked in both the custom and production home-building industries where he has served as a builder, estimator, project manager and vice president of construction. A husband and father of 2 children, Mike enjoys the outdoors and spending time with his family. Mikes roots in Bolivar started in 1979 when his Aunt LaNell and Uncle Eddie Oehlers bought their first beach house in Gilchrist. Mike spent many summers and family holidays enjoying all that Bolivar had to offer. His Uncle Eddie always referred to the Bolivar peninsula as Gods Country. It was this sentiment that made rebuilding his familys beach home after hurricane Ike one of his most gratifying experiences. He now looks forward to building more Bolivar custom homes so he can share this love and experience with you and your family.',
