                'id' => 950,
                'name' => 'BUILTEX',
                'slug' => 'builtex',
                'descr' => 'Quality you see and feel. Our owner Tony Zaiden is a certified home inspector and past president of American Society of Construction Analysts and has served as a board member of multiple Home Inspection Organizations. Tony established Builtex homes to fill the need in Houston and Galveston areas for custom quality homes and remodels that stand the test of time. When Hurricane Ike devastated the San Leon area, the owners of the Builtex Homes were secure and suffered little damage compared to our neighbors, many of whom were displaced from their homes for months.
Our clients enjoy their custom homes with personalized features that make it as unique as they are. We understand this is one of the most personalized decisions you will make and we begin our building process with your needs and wants to create the home that has been designed and built solely with you in mind. Our team is ready to work with you from start to finish including locating the lot, arranging financing to scheduling your movers. Check out Tony\'s FAQ\'s and our Getting Started page for additional information that will assist you in your home building process.
Our features ensure that your home can meet your needs of today and tomorrow. Built to the highest construction standards the advantage of a Builtex Home is built to match the highest wind codes of Texas regardless of location. Our homes also provide you the ability to age in place with features such as roughed-in elevator and central vac, wide bathrooms and open main living areas.
Distinctive designs that make your home unique are what makes A-Builtex Home your builder of choice. Whether you are looking to build a 1400 or 10,000 square foot home our depth of experience of inspections, remodeling and custom building provides you a wide range of features to choose from.
Our homes are designed and built to be beautiful and functional  a home you will be proud of.
Quality you live and feel every day.',
