            464 =>
            array (
                'id' => 966,
                'name' => 'Advantage Homes',
                'slug' => 'advantage-homes',
                'descr' => 'Jim Gerhart, President of Advantage Homes, has a keen eye for value and a simple philosophy: Build homes that rise above the mediocrity of most builders. Personal integrity, attention to detail and oversight of all phases of construction insure that buyers get a high quality home for a fair price.

Buying a home is one of lifes major events, says Mr. Gerhart. Buyers spend a lot money, time and emotion on purchasing a new home, they dont need any extra stress or uncertainty. They are our livelihood, so we dont take their concerns lightly.

Helping Mr. Gerhart is Charles Breazeale, an experienced homebuilder and remodeler from California who shares in Mr. Gerharts building philosophy and commitment to quality. Mr. Breazeale oversees day-to-day operations and can be found at each Advantage Homes project daily. Mr. Breazeale has held a California contractor\'s license since 2001. His attention to detail, knowledge of strict California codes and fresh west coast ideas helps ensure Advantage Homes remains a step above other area homebuilders.

My job is to make sure everything is done right, says Mr. Breazeale. Nothing less will do. Mr. Breazeale adds, As a homebuilder who wants their pride to show in their product, thats good enough or no one will know the difference is no excuse for poor quality or workmanship. We employ contractors who show personal pride in what they do and want to get it right just as much as we do. My commitment to you is, if its not right, I will make it right.

"You don\'t have to take our word that we build the best new homes in the area." Mr. Gerhart says. "Ask our homeowners. What they have to say about us and our homes is best advertisement we can have. Advantage Homes\' reputation as a quality home building company is very important to me!"

Since 2003, Advantage Homes has built more than 100 homes in the Montgomery County and Lake Conroe area. Recently completed projects featured in our "Exterior Photo Gallery" and "Interior Photo Gallery" demonstrate the high quality and timeless architectural designs offered by Advantage Homes.',
