            2 =>
            array (
                'id' => 1004,
                'name' => 'D. Wilson Construction',
                'slug' => 'd-wilson-construction',
                'descr' => 'D. Wilson Construction was started by Darrell Wilson in 1957 with the vision of bringing personal attention to each project and giving every client the commitment they deserve. D. Wilson is now led by Darrells son, Bill Wilson.
Since its founding, D. Wilson Construction has demonstrated its capability and creativity in a variety of projects across the Rio Grande Valley, including, Casa de la Palmas Hotel, KGBT television station, warehouse space in the Foreign Trade Zone, shopping centers on Nolana and 10th Street in McAllen, shopping plazas on Sunshine Strip in Harlingen  all examples of practical construction methods yielding a beautiful appearance and a profitable utility. D. Wilson Construction is also responsible for more than a million square feet of warehouse space occupied by companies such as AT&T, Whirlpool, TRW, Penske and American Electric Power, to name a few.
D. Wilson Construction is also proud of the work the company has done for the State of Texas and the United States Government. Facilities such as The State Veterans Cemetery, The World Birding Center, various US Postal Service facilities and numerous University of Texas System projects can be seen across South Texas.
In January of 2010, D WIlson Construction opened an office in San Antonio to better serve the South Texas market. Sinceopening, the San Antonio Regional Office has completed many projects includingHerman Hirsch Elementary for SAISD, the Animal Adoption Center and baseball fields for the City of Schertz, the Marmion Cancer Center at Uvalde Memorial Hospital, the Fannin Battleground Museum, and the Boerne Pedestrian Trails.The San Antonio office servesUvalde, Fredericksburg, Waring, Stockdale, Boerne, Corpus Christi, Karnes City, Lockhart, Refugio, Fannin, Kerrville and Schertz as well as San Antonio.
D. Wilson Construction\'s extensive experience in the Rio Grande Valley and San Antonio, and relationships with highly competent and cost-efficient subcontractors and suppliers, allow D. Wilson to help clients reduce construction costs without compromising design or function.
For decades, D. Wilson has also been working with clients on a design/build basis and has become actively involved at the beginning of projects  working on assessing needs, site selection and design  delivering truly creative, cost-effective solutions to clients\' facility requirements.
With the great reputation and services D. Wilson Construction delivers, it should come as no surprise that Texas Construction magazine ranked D. Wilson Construction as one of Texas Top 100 Construction Companies. D. Wilson Construction Company is building today, for the future.',
