                'slug' => 'lacasa-builders',
                'descr' => 'Ron Steege and Tim Larson, co-founders of La Casa Builders Inc. in Scottsdale Arizona, have balanced the delicate beauty of the Sonoran Desert with artistic design and the unique vision of the homeowner in each of the custom homes they build.
