            array (
                'id' => 1155,
                'name' => 'RG Homes',
                'slug' => 'rg-homes',
                'descr' => 'We design, build and remodel homes in Houston Texas. Our award-winning projectsperfectly reflect our clients desire to share in the exceptionallifestyle that makes this one of the most desired citiesin Texas.

