                'descr' => 'Chadwick Homes began with a vision and a dream of building a superior home based on quality, craftsmanship, value, and price for each and every customer. Chadwick Homes founder, Chad Stultz, has over15 years of experience in the residential construction industry. Chad graduated from Baylor University with a degree in Real Estate and Entrepreneurship. Since then, he has worked in the new home industry for major corporate builders in the Houston area. Having gained experience in the fields of sales, finance, and construction of new homes, Chad offers quite an advantage over competitors. Being familiar with all sides of the new home business, Chad mentors homeowners throughout the complete home buying process by helping with financing and design questions, as well as pricing and budgeting questions, which allows them to achieve the best value possible. This knowledge makes our homeowners feel like part of our team when building their new home.
