                'descr' => 'What could be more important than selecting the right buildera builder who listens and shares your vision, a builder who respects your time and input, a builder with the unmatched passion to meet and exceed your expectations in an unexpected way. There is perhaps no purchase more important to you and your family. Its not just a blueprint or a floor plan. Its the stage on which your story will be written. Because Life Happens Here.
