            273 =>
            array (
                'id' => 1277,
                'name' => 'CORBELLA INC',
                'slug' => 'corbella-inc',
                'descr' => 'Corbella, Inc. through its affiliated companies has been designing and building homes in the Houston, TX Metropolitan area for more than a decade. Our Company specializes in the creative design and construction of quality custom homes at a competitive price. Making our clients\' Dreams a Reality. Corbella is owned and operated by John C Hamilton, its CEO and by Steve Folkes, its President. John, a former commercial banker and certified financial planner as well as a Houston area Entrepreneur with many years of experience handles the financial and administrative duties, while Steve handles the design and construction management duties. Steve Folkes began his architectural career in 1991 and has worked with firms such as Jack Preston Wood, Design Inc., Rice University and Sullivan, Stevens and Henry Associates, Inc. As a builder, his prior company, HomeFront Ltd. earned a reputation as an outstanding, creative and dependable builder in the Houston area. Successfully providing new construction and remodeled additions that met modern conveniences. Together, John and Steve have over 35 years of experience. In addition to our custom building projects, we have designed and built homes on a speculative basis in some of Houston\'s premier communities. We also offer remodeling services for clients who may wish to build an addition or modify their existing home. By choosing Corbella as your partner in the design, construction or remodeling of your home, you will take comfort in knowing you have chosen one of the very best! ',
