                'id' => 1278,
                'name' => 'Krieger Containers',
                'slug' => 'krieger-containers',
                'descr' => 'While many builders across the world have done projects incorporating shipping containers, few have been able to replicate success. Krieger Containers has found how to cost-efficiently incorporate shipping containers into the design and structure of buildings in Houston. Buyers can expect high quality closed-cell insulation, drilled pier foundations, and the structural strength inherent of containers. Incorporating containers allows for a high quality product at prices below competition. Krieger Containers is the lowest cost per square foot builder in the City of Houston, guaranteed.',
