                'name' => 'Block House Construc',
                'slug' => 'block-house-construc',
                'descr' => 'Locally owned and operated, we perform all levels of building and remodeling. We offer start-to-finish solutions for every project. We also offer full design services in-house. We specialize in new home constructions, from planning to building!

We are committed to high-quality and low environmental impact construction for each and every project. Check out samples of our recent work, and you\'ll agree that we\'re the best choice for your home project.

Felix Chen, Principal of Block House Construction, Inc.,  graduated from Texas A &M University in 94 with a degree in Environmental Design with outstanding marks in this field of study.  He quickly applied his design skills at Signature Group, Inc., drawing custom home plans for use nationwide. He then gained construction-supervising experience over the next 5 years by building tract, custom, and town homes in southwest Houston, Katy, West Houston, Baytown, Seabrook, Clearlake, and Pasadena for Robert William Homes and Kimball Hill Homes before focusing on Houstons Inner Loop.

Forming a partnership in 1997, Silverstone Designers and Contractors, Inc. designed and built homes that significantly took part in Houstons urban renewal.  Area including Houston Heights, Camp Logan, Upper Kirby, Montrose, Spring Branch, Champion, Woodlands, Braes Heights, Bellaire, and West University.

Now, through Block House Construction, Inc., all projects from concept to completion are managed with 21 years of experience and knowledge, merging the commitments of building one-of-a-kind modern and transitional household designs with creative construction detail.

Because we only commit ourselves to a select numbers of projects each year, the homes we are building receive the highest attention to design execution and construction management.',
