            341 =>
            array (
                'id' => 1345,
                'name' => 'NEW CAMDEN HOMES',
                'slug' => 'new-camden-homes',
                'descr' => 'New Camden Homes is a Houston-area custom builder that understands quality building practices and incorporates proven, forward-thinking construction techniques with innovative design that feels fresh now, and will stand the test of time.

Since 2003, New Camden Homes has brought clients and leading architects together to create stylish yet functional homes that provide exceptional value, as well. Always seeking the perfect balance of style, custom features and value makes this possible. Our vision is a home that reflects the clients vision and respects the clients investment.

New Camden Homes has partnered with clients to build homes from close-in Bellaire to the rolling hills of Fulshear, on lots owned by clients and those owned by New Camden Homes. The end result is always a home that reflects vision, quality and exceptional value.

About New Camden Homes

New Camden Homes began in 2003 when Tim McGonagle took 20-plus years of experience in Houston-area home building and created his idea of what a custom homebuilding company should be  a thoughtful combination of vision, quality and value.

Drawing on experience in the field and in senior management with such companies as David Weekley Homes, Village Builders and Trendmaker Homes, hes built a company that works closely with clients throughout to the building process from design through completion.

There are New Camden homes in Bellaire, Houston, Spring Valley and Memorial, as well as in Richmond and Fulshear. Some were built on our lots, others on the clients lots, and were still that flexible.

Choose a New Camden Homes design and customize it as needed, or can bring your own plans. Our close partnership with several architects means we can help clients who have nothing more than a vision realize their dreams.

Theres even an option for those who dont want or dont have time for a design-and-build experience. Chances are we have homes under construction or almost complete available in Westin Lakes, a golf-course community in Fulshear.',
