                'name' => 'Inflection Design',
                'slug' => 'inflection-design',
                'descr' => 'Inflection Design Group, LLC, dba Acadian Custom Homesisowned and operated by Jack Lin. Originally from the East Coast, Jack earned a dual degree in Bachelor of Arts and Science in Architecture and Civil Engineering at Columbia University in 1996. Although he has had a long standing commitment to architecture and construction, he did not enter the real estate industry right away. After graduating, he had the opportunity to help Accenture, the IT management consulting firm, build the 311 call center for New York City, the largest in the country.
