                'descr' => 'Leitch Properties is a premier boutique builder that specializes in designing and building high-quality luxury residences in West University, Texas, and surrounding areas. Leitch Properties was started by Justin Leitch, an active resident of West University since 2009. Justin is also a principal at Dkota Investments, a national build to suit company that specializes in industrial and warehouse development for various Fortune 500 companies. Justin has over a decade of experience in industrial and residential construction. He continues to develop build-to-suit distribution warehouses all over the country.
