                'descr' => 'Midani Homes is a family owned and operated high-end residential building company with almost 50 years of experience building luxury homes in Houstons finest neighborhoods.  Our philosophy is simple and straightforward: we build quality homes that stand the test of time and become the classics of tomorrow.
