With customer needs at the forefront of our operation, were dedicated to providing long-term value by decreasing the overall cost of home-ownership. The industry-leading, energy efficiency of every new First Texas home is achieved by taking advantage of the latest advances in energy-saving building techniques, as well as the use of high efficiency appliances, fixtures, and mechanical systems.

