                'descr' => 'At Metropolitan Custom Homes, we continually strive to be a leader in the Houston area. With an individual, personalized and unique approach, we consistently translate our customers needs into the home of their dreams. No corner is cut, no detail overlooked and no compromise made in ensuring quality and craftsmanship for each home.
