                'slug' => 'corbel-custom-homes-inc',
                'descr' => 'Corbels business strategy has not changed since our first day of business, over 11 years ago. Simply put, we want to be the premier builder in the highest quality neighborhoods in Houston. As the owners, Mike and Nick Bregenzer have dedicated all of their time and energy into building the highest quality, most efficiently priced homes in the neighborhoods in which they both live. Since 2003, we have specialized in custom build to suit homes and remodels in Memorial, Tanglewood, West University, and Bellaire.


