            320 =>
            array (
                'id' => 1830,
                'name' => 'M. Daigle Custom Homes, LLC',
                'slug' => 'm-daigle-custom-homes-llc',
                'descr' => 'Mark Daigle of Montgomery County, Texas, began his career in 1981. He learned the fundamentals of home building business while working with his father in East Texas. Over the course of 30 years, he has held executive positions with some of the nations largest and most successful home building companies, and has maintained a passion for building homes for Texas families.
In 1988, Mark made a transition from the family business and took a position with the 7th largest builder in the nation at the time. Shortly thereafter, he was recruited by the founders of that company to join a new firm building larger and higher end homes. Starting out as a builder, he was quickly elevated to a project management role, maintaining sales and construction responsibilities for some of their largest and most successful projects.
Mark was later recruited to join one of the oldest and most successful Build on Your Lot companies in Texas in 1996. Starting out as a builder, he soon moved into a role as the Vice-President of Construction with the firm. Over the course of his tenure, he managed construction operations for the company state wide, and led their construction business through some of the largest growth and expansion in the companys history.
In 2006, Mark was recruited by a national Build on Your Lot builder to initiate their operations and lead their expansion into the Texas market. He established the companys regional administrative office, and developed two successful retail design centers in the Houston metropolitan market. He later assumed the management of the Louisiana and Arkansas operations, which were ultimately combined with the Texas Region to create what is now the South Central Region of the U.S. for the company. After a long career working with some of the nations most prominent home builders, he decided to start his own firm to return his focus to customer service.
Mark is a member of the Greater Houston Builders Association (GHBA), and was honored to serve as Chairman of the prestigious GHBA Codes and Standards Committee for 2006. He also holds the designation of Graduate Master Builder (GMB) as recognized by the National Association of Home Builders (NAHB).
