                'name' => 'Philip J. Douglas, Inc.',
                'slug' => 'philip-j-douglas-inc',
                'descr' => 'Philip J. Douglas, Inc. has significant experience with custom home construction and remodeling. We have worked hard to develop and maintain our reputation for work that is done right and for projects that are delivered on-time without surprises. We are confident that you too will find the way we conduct business and our product second to none.

