                'id' => 1849,
                'name' => 'Precision Homes',
                'slug' => 'precision-homes',
                'descr' => 'Hello, I am Henry Wieghat, Ownerof Precision Homes Custom Builders, Inc. and I want to personally thank you for your interest in our company and the products that we offer.
I have been working in the construction business since I was 16 years old back in Brenham, Texas. I later moved to Houston and began working for a large homebuilder as a clean-up man. By working my way up to foreman, I literally learned homebuilding from the ground up. My on-the-job training taught me everything from form setting, concrete work and framing to final finish and inspections. Along the way, I discovered a knack for getting the best out of my fellow workers. This gift allowed me to become a production superintendent; running crews efficiently while maintaining high production. I later became the vice president of another building firm where I was involved with all phases of construction, business planning, sales and closings.
In 1960, my experience allowed me to start Precision Homes as a custom build on your lot homebuilder. Over the years I have learned a lot about building houses without losing sight of always putting the customers needs first. We understand what it takes to make a house a home and we want to earn your trust. I have a fine Team whose purpose is to make sure that we offer you a quality built home at an affordable price, designed to hold its value and last for years to come. I hope that you will give us the opportunity to help you realize your homebuilding dream.',
