            353 =>
            array (
                'id' => 1863,
                'name' => 'Sierra Classic Custom Homes',
                'slug' => 'sierra-classic-custom-homes',
                'descr' => '1. INITIAL MEETING
This is where we get to know you. We discuss your wants and needs for your new home. We allow you to choose your home from our vast library of floor plans, modify it to make it your own, or bring in your own plan and ideas, and well help bring them to life!

2. HOME ESTIMATE PREPARED
As a custom homebuilder, we understand that each client has individual preferences and desires in their home. We will work with you to personalize the features in your home to suit your specific lifestyle and reach your budget goals. Following this discussion, we will provide you with a detailed estimate.

3. SITE EVALUATION
Have you already purchased that perfect piece of land for your new home? If so, Sierra Classic Custom Homes will provide you with an itemized estimate of site costs after conducting your Complimentary Site Evaluation. Dont have land yet? Don\'t worry; we can help with that too!

4. DESIGN PRE-CONTRACT
Now that you have approved your home and site cost estimates, its time to put the design team to work. Our buyer-friendly Design Pre-Contract commissions the production of your new home plans.

5. HOME PLAN DESIGNED
Our design team will work closely with you and your custom home consultant to put your vision on paper. Your new floorplan and elevations will come to life, and give you the opportunity to review and approve your designs BEFORE signing a contract to build. Just another step in our efforts to make sure there are no surprises.

6. CONTRACT & CLOSING
Once you have approved your floorplan and elevations, our estimating team will provide you with an itemized, fixed-price cost to build your new home. We want to insure that you have all of the information necessary to feel comfortable about signing a contract to build with us. Your custom home consultant will help you complete your new home contract, and if financing your new home, we will work with your lender to complete your interim construction loan closing.

7. CONSTRUCTION
Now the real magic begins! Your builder will work hand in hand with you through the construction of your new home. We will keep you apprised of the progress throughout construction through personal communication, our online buyer website portal, and through your own personal smart phone app. You will never be out of the loop as we bring your vision to life.

8. HOME COMPLETION
After conducting a final walk through and approval of your new home with your builder, we now have the honor of presenting you with your new custom home. Welcome to the Sierra Classic Custom Homes family.',
