                'descr' => 'The William Baker Company is a well-known independent manufacturers representative serving the commercial construction industry. We are the eyes and ears in the Indiana and Central Kentucky territories for those manufacturers we currently represent, and for those we aspire to represent in the future. We endeavor to build customer-friendly relationships by empowering everyone who works here to conduct themselves as if they own the company. We acquire, service, and maintain our customers by adding value to their purchase decisions through being available to expedite responses to their needs, questions, and orders.

