                'name' => 'H Square Design',
                'slug' => 'h-square-design',
                'descr' => 'H Square Design Build is an architectural and construction firm dedicated to delivering the highest level of quality and value through unmatched customer service and attention to detail. From conception to completion, H Square is the provider of choice for luxury home construction, beautiful vacation escapes, and innovative remodeling for highly discerning individuals passionate about their future home.
